import{_ as t,o as d,c as e,d as a}from"./app.3511e8d2.js";const i={},l=a('<h1 id="\u6570\u636E\u4ED3\u5E93\u5EFA\u6A21" tabindex="-1"><a class="header-anchor" href="#\u6570\u636E\u4ED3\u5E93\u5EFA\u6A21" aria-hidden="true">#</a> \u6570\u636E\u4ED3\u5E93\u5EFA\u6A21</h1><h2 id="\u6982\u8FF0" tabindex="-1"><a class="header-anchor" href="#\u6982\u8FF0" aria-hidden="true">#</a> \u6982\u8FF0</h2><p>\u8FDB\u884C\u7535\u5546\u6570\u636E\u4ED3\u5E93\u5EFA\u6A21\uFF0C\u8FDB\u884C\u591A\u5C42\u6B21\u5EFA\u6A21\u89C4\u5212\uFF0C\u4EE5\u4E0B\u4E3A\u6570\u636E\u4ED3\u5E93\u5EFA\u6A21\u613F\u666F:</p><ul><li>\u8BBF\u95EE\u6027\u80FD\uFF1A\u80FD\u591F\u5FEB\u901F\u67E5\u8BE2\u6240\u9700\u7684\u6570\u636E\uFF0C\u51CF\u5C11\u6570\u636E I/O\u3002</li><li>\u6570\u636E\u6210\u672C\uFF1A\u51CF\u5C11\u4E0D\u5FC5\u8981\u7684\u6570\u636E\u5197\u4F59\uFF0C\u5B9E\u73B0\u8BA1\u7B97\u7ED3\u679C\u6570\u636E\u590D\u7528\uFF0C\u964D\u4F4E\u5927\u6570\u636E\u7CFB\u7EDF\u4E2D\u7684\u5B58\u50A8\u6210\u672C\u548C\u8BA1\u7B97\u6210\u672C\u3002</li><li>\u4F7F\u7528\u6548\u7387\uFF1A\u6539\u5584\u7528\u6237\u5E94\u7528\u4F53\u9A8C\uFF0C\u63D0\u9AD8\u4F7F\u7528\u6570\u636E\u7684\u6548\u7387\u3002</li><li>\u6570\u636E\u8D28\u91CF\uFF1A\u6539\u5584\u6570\u636E\u7EDF\u8BA1\u53E3\u5F84\u7684\u4E0D\u4E00\u81F4\u6027\uFF0C\u51CF\u5C11\u6570\u636E\u8BA1\u7B97\u9519\u8BEF\u7684\u53EF\u80FD\u6027\uFF0C\u63D0\u4F9B\u9AD8\u8D28\u91CF\u7684\u3001\u4E00\u81F4\u7684\u6570\u636E\u8BBF\u95EE\u5E73\u53F0\u3002</li></ul><h2 id="\u6570\u4ED3\u5EFA\u6A21" tabindex="-1"><a class="header-anchor" href="#\u6570\u4ED3\u5EFA\u6A21" aria-hidden="true">#</a> \u6570\u4ED3\u5EFA\u6A21</h2><h3 id="ods-\u5C42" tabindex="-1"><a class="header-anchor" href="#ods-\u5C42" aria-hidden="true">#</a> ODS \u5C42</h3><p>\u8FDB\u884C HDFS \u7528\u6237\u884C\u4E3A\u6570\u636E\u548C\u4E1A\u52A1\u6570\u636E\u5EFA\u6A21</p><ul><li>\u4FDD\u6301\u6570\u636E\u539F\u8C8C\u4E0D\u505A\u4EFB\u4F55\u4FEE\u6539,\u8D77\u5230\u5907\u4EFD\u6570\u636E\u7684\u4F5C\u7528\u3002</li><li>\u6570\u636E\u91C7\u7528\u538B\u7F29,\u51CF\u5C11\u78C1\u76D8\u5B58\u50A8\u7A7A\u95F4(\u4F8B\u5982:\u539F\u59CB\u6570\u636E 100G,\u53EF\u4EE5\u538B\u7F29\u5230 10G \u5DE6\u53F3)</li><li>\u521B\u5EFA\u5206\u533A\u8868,\u9632\u6B62\u540E\u7EED\u7684\u5168\u8868\u626B\u63CF</li><li>\u521B\u5EFA\u5206\u533A\u8868\uFF0C\u9632\u6B62\u540E\u7EED\u7684\u5168\u8868\u626B\u63CF\uFF0C \u5728\u4F01\u4E1A\u5F00\u53D1\u4E2D\u5927\u91CF\u4F7F\u7528\u5206\u533A\u8868\u3002</li><li>\u521B\u5EFA\u5916\u90E8\u8868\u3002\u5728\u4F01\u4E1A\u5F00\u53D1\u4E2D\uFF0C\u9664\u4E86\u81EA\u5DF1\u7528\u7684\u4E34\u65F6\u8868\uFF0C\u521B\u5EFA\u5185\u90E8\u8868\u5916\uFF0C\u7EDD\u5927\u591A\u6570\u573A\u666F \u90FD\u662F\u521B\u5EFA\u5916\u90E8\u8868\u3002</li></ul><h3 id="dwd-\u5C42" tabindex="-1"><a class="header-anchor" href="#dwd-\u5C42" aria-hidden="true">#</a> DWD \u5C42</h3><p>\u7528\u6237\u884C\u4E3A\u6570\u636E\u5206\u6790\u64CD\u4F5C\u4E3A\uFF1A</p><ul><li>\u5BF9\u7528\u6237\u884C\u4E3A\u8FDB\u884C\u6570\u636E\u89E3\u6790</li><li>\u5BF9\u6838\u5FC3\u6570\u636E\u8FDB\u884C\u5224\u7A7A\u8FC7\u6EE4</li><li>\u5BF9\u4E1A\u52A1\u6570\u636E\u91C7\u7528\u7EF4\u5EA6\u6A21\u578B\u91CD\u65B0\u5EFA\u6A21</li></ul><p>\u4E1A\u52A1\u6570\u636E\u5206\u6790\u7684\u64CD\u4F5C\u4E3B\u8981\u4E3A\uFF1A</p><ul><li>\u4E1A\u52A1\u6570\u636E\u65B9\u9762 DWD \u5C42\u7684\u642D\u5EFA\u4E3B\u8981\u6CE8\u610F\u70B9\u5728\u4E8E\u7EF4\u5EA6\u5EFA\u6A21</li><li>\u51CF\u5C11\u540E\u7EED\u5927\u91CF Join \u64CD\u4F5C</li></ul><p>DWD \u5C42\u9700\u6784\u5EFA\u7EF4\u5EA6\u6A21\u578B,\u4E00\u822C\u91C7\u7528\u661F\u578B\u6A21\u578B,\u5448\u73B0\u7684\u72B6\u6001\u4E00\u822C\u4E3A\u661F\u5EA7\u6A21\u578B\u3002</p><p>\u7EF4\u5EA6\u5EFA\u6A21\u4E00\u822C\u6309\u7167\u4EE5\u4E0B\u56DB\u4E2A\u6B65\u9AA4:</p><ul><li>\u9009\u62E9\u4E1A\u52A1\u8FC7\u7A0B</li><li>\u58F0\u660E\u7C92\u5EA6</li><li>\u786E\u8BA4\u7EF4\u5EA6</li><li>\u786E\u8BA4\u4E8B\u5B9E</li></ul><h4 id="\u9009\u62E9\u4E1A\u52A1\u8FC7\u7A0B" tabindex="-1"><a class="header-anchor" href="#\u9009\u62E9\u4E1A\u52A1\u8FC7\u7A0B" aria-hidden="true">#</a> \u9009\u62E9\u4E1A\u52A1\u8FC7\u7A0B</h4><blockquote><p>\u5982\u679C\u662F\u4E2D\u5C0F\u56E2\u961F,\u5C3D\u91CF\u628A\u6240\u6709\u4E1A\u52A1\u8FC7\u7A0B\u90FD\u9009\u62E9\u3002 \u5982\u679C\u662F\u5927\u56E2\u961F\uFF081000 \u591A\u5F20\u8868\uFF09\uFF0C\u9009\u62E9\u548C\u9700\u6C42\u76F8\u5173\u7684\u4E1A\u52A1\u7EBF\u3002</p></blockquote><p>\u5728\u4E1A\u52A1\u7CFB\u7EDF\u4E2D,\u6311\u9009\u6211\u4EEC\u611F\u5174\u8DA3\u7684\u4E1A\u52A1\u7EBF,\u6BD4\u5982\u4E0B\u5355\u4E1A\u52A1,\u652F\u4ED8\u4E1A\u52A1,\u9000\u6B3E\u4E1A\u52A1, \u7269\u6D41\u4E1A\u52A1,\u4E00\u6761\u4E1A\u52A1\u7EBF\u5BF9\u5E94\u4E00\u5F20\u4E8B\u5B9E\u8868\u3002</p><h4 id="\u58F0\u660E\u7C92\u5EA6" tabindex="-1"><a class="header-anchor" href="#\u58F0\u660E\u7C92\u5EA6" aria-hidden="true">#</a> \u58F0\u660E\u7C92\u5EA6</h4><p>\u6570\u636E\u7C92\u5EA6\u6307\u6570\u636E\u4ED3\u5E93\u7684\u6570\u636E\u4E2D\u4FDD\u5B58\u6570\u636E\u7684\u7EC6\u5316\u7A0B\u5EA6\u6216\u7EFC\u5408\u7A0B\u5EA6\u7684\u7EA7\u522B\u3002 \u58F0\u660E\u7C92\u5EA6\u610F\u5473\u7740\u7CBE\u786E\u5B9A\u4E49\u4E8B\u5B9E\u8868\u4E2D\u7684\u4E00\u884C\u6570\u636E\u8868\u793A\u4EC0\u4E48\uFF0C\u5E94\u8BE5\u5C3D\u53EF\u80FD\u9009\u62E9\u6700\u5C0F\u7C92\u5EA6\uFF0C\u4EE5 \u6B64\u6765\u5E94\u5404\u79CD\u5404\u6837\u7684\u9700\u6C42\u3002</p><p>\u5178\u578B\u7684\u7C92\u5EA6\u58F0\u660E\u5982\u4E0B\uFF1A \u8BA2\u5355\u4E8B\u5B9E\u8868\u4E2D\u4E00\u884C\u6570\u636E\u8868\u793A\u7684\u662F\u4E00\u4E2A\u8BA2\u5355\u4E2D\u7684\u4E00\u4E2A\u5546\u54C1\u9879\u3002 \u652F\u4ED8\u4E8B\u5B9E\u8868\u4E2D\u4E00\u884C\u6570\u636E\u8868\u793A\u7684\u662F\u4E00\u4E2A\u652F\u4ED8\u8BB0\u5F55\u3002</p><h4 id="\u786E\u5B9A\u7EF4\u5EA6" tabindex="-1"><a class="header-anchor" href="#\u786E\u5B9A\u7EF4\u5EA6" aria-hidden="true">#</a> \u786E\u5B9A\u7EF4\u5EA6</h4><p>\u7EF4\u5EA6\u7684\u4E3B\u8981\u4F5C\u7528\u662F\u63CF\u8FF0\u4E1A\u52A1\u662F\u4E8B\u5B9E\uFF0C\u4E3B\u8981\u8868\u793A\u7684\u662F\u201C\u8C01\uFF0C\u4F55\u5904\uFF0C\u4F55\u65F6\u201D\u7B49\u4FE1\u606F\u3002 \u786E\u5B9A\u7EF4\u5EA6\u7684\u539F\u5219\u662F\uFF1A\u540E\u7EED\u9700\u6C42\u4E2D\u662F\u5426\u8981\u5206\u6790\u76F8\u5173\u7EF4\u5EA6\u7684\u6307\u6807\u3002\u4F8B\u5982\uFF0C\u9700\u8981\u7EDF\u8BA1\uFF0C\u4EC0\u4E48\u65F6 \u95F4\u4E0B\u7684\u8BA2\u5355\u591A\uFF0C\u54EA\u4E2A\u5730\u533A\u4E0B\u7684\u8BA2\u5355\u591A\uFF0C\u54EA\u4E2A\u7528\u6237\u4E0B\u7684\u8BA2\u5355\u591A\u3002\u9700\u8981\u786E\u5B9A\u7684\u7EF4\u5EA6\u5C31\u5305\u62EC\uFF1A\u65F6\u95F4 \u7EF4\u5EA6\u3001\u5730\u533A\u7EF4\u5EA6\u3001\u7528\u6237\u7EF4\u5EA6\u3002</p><h4 id="\u786E\u5B9A\u4E8B\u5B9E" tabindex="-1"><a class="header-anchor" href="#\u786E\u5B9A\u4E8B\u5B9E" aria-hidden="true">#</a> \u786E\u5B9A\u4E8B\u5B9E</h4><p>\u6B64\u5904\u7684&quot;\u4E8B\u5B9E&quot;\u4E00\u8BCD\uFF0C\u6307\u7684\u662F\u4E1A\u52A1\u4E2D\u7684\u5EA6\u91CF\u503C\uFF08\u6B21\u6570\u3001\u4E2A\u6570\u3001\u4EF6\u6570\u3001\u91D1\u989D\uFF0C\u53EF\u4EE5\u8FDB\u884C\u7D2F \u52A0\uFF09 \uFF0C\u4F8B\u5982\u8BA2\u5355\u91D1\u989D\u3001\u4E0B\u5355\u6B21\u6570\u7B49\u3002</p><p>\u5728 DWD \u5C42\uFF0C \u4EE5\u4E1A\u52A1\u8FC7\u7A0B\u4E3A\u5EFA\u6A21\u9A71\u52A8\uFF0C\u57FA\u4E8E\u6BCF\u4E2A\u5177\u4F53\u4E1A\u52A1\u8FC7\u7A0B\u7684\u7279\u70B9\uFF0C\u6784\u5EFA\u6700\u7EC6\u7C92\u5EA6\u7684 \u660E\u7EC6\u5C42\u4E8B\u5B9E\u8868\u3002\u4E8B\u5B9E\u8868\u53EF\u505A\u9002\u5F53\u7684\u5BBD\u8868\u5316\u5904\u7406\u3002</p><p>\u4E8B\u5B9E\u8868\u548C\u7EF4\u5EA6\u8868\u7684\u5173\u8054\u6BD4\u8F83\u7075\u6D3B\uFF0C\u4F46\u662F\u4E3A\u4E86\u5E94\u5BF9\u66F4\u590D\u6742\u7684\u4E1A\u52A1\u9700\u6C42\uFF0C\u53EF\u4EE5\u5C06\u80FD\u5173\u8054\u4E0A\u7684 \u8868\u5C3D\u91CF\u5173\u8054\u4E0A\u3002\u5728\u4E1A\u52A1\u8868\u5173\u7CFB\u56FE\u4E2D\uFF0C\u53EA\u8981\u4E24\u5F20\u8868\u80FD\u901A\u8FC7\u4E2D\u95F4\u8868\u80FD\u591F\u5173\u8054\u4E0A\uFF0C\u5C31\u8BF4\u660E\u80FD\u5173\u8054\u4E0A\u3002</p><table><thead><tr><th style="text-align:center;">\u5E8F\u53F7</th><th></th><th>\u65F6\u95F4</th><th>\u7528\u6237</th><th>\u5730\u533A</th><th>\u5546\u54C1</th><th>\u4F18\u60E0\u5238</th><th>\u6D3B\u52A8</th><th>\u7F16\u7801</th><th>\u5EA6\u91CF\u503C</th></tr></thead><tbody><tr><td style="text-align:center;">1</td><td>\u8BA2\u5355</td><td>\u221A</td><td>\u221A</td><td>\u221A</td><td></td><td></td><td>\u221A</td><td></td><td>\u4EF6\u6570/\u91D1\u989D</td></tr><tr><td style="text-align:center;">2</td><td>\u8BA2\u5355\u8BE6\u60C5</td><td>\u221A</td><td>\u221A</td><td>\u221A</td><td>\u221A</td><td></td><td></td><td></td><td>\u4EF6\u6570/\u91D1\u989D</td></tr><tr><td style="text-align:center;">3</td><td>\u652F\u4ED8</td><td>\u221A</td><td>\u221A</td><td>\u221A</td><td></td><td></td><td></td><td></td><td>\u91D1\u989D</td></tr><tr><td style="text-align:center;">4</td><td>\u52A0\u8D2D</td><td>\u221A</td><td>\u221A</td><td></td><td>\u221A</td><td></td><td></td><td></td><td>\u4EF6\u6570/\u91D1\u989D</td></tr><tr><td style="text-align:center;">5</td><td>\u6536\u85CF</td><td>\u221A</td><td>\u221A</td><td></td><td>\u221A</td><td></td><td></td><td></td><td>\u4E2A\u6570</td></tr><tr><td style="text-align:center;">6</td><td>\u8BC4\u4EF7</td><td>\u221A</td><td>\u221A</td><td></td><td>\u221A</td><td></td><td></td><td></td><td>\u4E2A\u6570</td></tr><tr><td style="text-align:center;">7</td><td>\u9000\u6B3E</td><td>\u221A</td><td>\u221A</td><td></td><td>\u221A</td><td></td><td></td><td></td><td>\u4EF6\u6570/\u91D1\u989D</td></tr><tr><td style="text-align:center;">8</td><td>\u4F18\u60E0\u5238\u9886\u7528</td><td>\u221A</td><td>\u221A</td><td></td><td></td><td>\u221A</td><td></td><td></td><td>\u4E2A\u6570</td></tr></tbody></table><p>\u6570\u636E\u4ED3\u5E93\u7684\u7EF4\u5EA6\u5EFA\u6A21\u57FA\u672C\u5B8C\u6210\uFF0CDWD \u5C42\u662F\u4EE5\u4E1A\u52A1\u8FC7\u7A0B\u4E3A\u9A71\u52A8\u3002</p><p>DWS \u5C42\u3001 DWT \u5C42\u548C ADS \u5C42\u90FD\u662F\u4EE5\u9700\u6C42\u4E3A\u9A71\u52A8\uFF0C\u548C\u7EF4\u5EA6\u5EFA\u6A21\u5DF2\u6CA1\u6709\u5173\u7CFB</p><h3 id="dws-\u5C42\u4E0E-dwt-\u5C42" tabindex="-1"><a class="header-anchor" href="#dws-\u5C42\u4E0E-dwt-\u5C42" aria-hidden="true">#</a> DWS \u5C42\u4E0E DWT \u5C42</h3><blockquote><p>DWS \u548C DWT \u90FD\u662F\u5EFA\u5BBD\u8868\uFF0C\u6309\u7167\u4E3B\u9898\u53BB\u5EFA\u8868\u3002\u4E3B\u9898\u76F8\u5F53\u4E8E\u89C2\u5BDF\u95EE\u9898\u7684\u89D2\u5EA6\u3002\u5BF9\u5E94\u7740\u7EF4\u5EA6\u8868\u3002</p></blockquote><p>DWS \u5C42\u548C DWT \u5C42\u7EDF\u79F0\u5BBD\u8868\u5C42,\u8FD9\u4E24\u5C42\u7684\u8BBE\u8BA1\u601D\u60F3\u5927\u81F4\u76F8\u540C,\u901A\u8FC7\u4EE5\u4E0B\u6848\u4F8B\u8FDB\u884C\u9610\u8FF0\u3002</p><ul><li>\u95EE\u9898\u5F15\u51FA:\u4E24\u4E2A\u9700\u6C42,\u7EDF\u8BA1\u6BCF\u4E2A\u7701\u4EFD\u8BA2\u5355\u7684\u4E2A\u6570\u3001\u7EDF\u8BA1\u6BCF\u4E2A\u7701\u4EFD\u8BA2\u5355\u7684\u603B\u91D1\u989D</li><li>\u5904\u7406\u529E\u6CD5:\u90FD\u662F\u5C06\u7701\u4EFD\u8868\u548C\u8BA2\u5355\u8868\u8FDB\u884C oin, group by \u7701\u4EFD,\u7136\u540E\u8BA1\u7B97\u540C\u6837\u6570\u636E\u88AB</li></ul><p>\u8BA1\u7B97\u4E86\u4E24\u6B21,\u5B9E\u9645\u4E0A\u7C7B\u4F3C\u7684\u573A\u666F\u8FD8\u4F1A\u66F4\u591A\u3002</p><p>\u907F\u514D\u91CD\u590D\u8BA1\u7B97:</p><p>\u9488\u5BF9\u4E0A\u8FF0\u573A\u666F,\u53EF\u4EE5\u8BBE\u8BA1\u4E00\u5F20\u5730\u533A\u5BBD\u8868,\u5176\u4E3B\u952E\u4E3A\u5730\u533A ID,\u5B57\u6BB5\u5305\u542B\u4E3A:\u4E0B\u5355\u6B21\u6570\u3001\u4E0B \u5355\u91D1\u989D\u3001\u652F\u4ED8\u6B21\u6570\u3001\u652F\u4ED8\u91D1\u989D\u7B49\u3002\u4E0A\u8FF0\u6240\u6709\u6307\u6807\u90FD\u7EDF\u4E00\u8FDB\u884C\u8BA1\u7B97,\u5E76\u5C06\u7ED3\u679C\u4FDD\u5B58\u5728\u8BE5\u5BBD\u8868\u4E2D, \u8FD9\u6837\u5C31\u80FD\u6709\u6548\u907F\u514D\u6570\u636E\u7684\u91CD\u590D\u8BA1\u7B97\u3002</p><h4 id="\u603B\u7ED3" tabindex="-1"><a class="header-anchor" href="#\u603B\u7ED3" aria-hidden="true">#</a> \u603B\u7ED3:</h4><ul><li>\u9700\u8981\u5EFA\u54EA\u4E9B\u5BBD\u8868:\u4EE5\u7EF4\u5EA6\u4E3A\u57FA\u51C6\u3002</li><li>\u5BBD\u8868\u91CC\u9762\u7684\u5B57\u6BB5:\u662F\u7AD9\u5728\u4E0D\u540C\u7EF4\u5EA6\u7684\u89D2\u5EA6\u53BB\u770B\u4E8B\u5B9E\u8868,\u91CD\u70B9\u5173\u6CE8\u4E8B\u5B9E\u8868\u805A\u5408\u540E\u7684\u5EA6\u91CF\u503C\u3002</li><li>DWS \u548C DWT \u5C42\u7684\u533A\u522B:DWS \u5C42\u5B58\u653E\u7684\u6240\u6709\u4E3B\u9898\u5BF9\u8C61\u5F53\u5929\u7684\u6C47\u603B\u884C\u4E3A,\u4F8B\u5982\u6BCF\u4E2A\u5730\u533A\u5F53\u5929\u7684\u4E0B\u5355\u6B21\u6570, \u4E0B\u5355\u91D1\u989D\u7B49,DWT \u5C42\u5B58\u653E\u7684\u662F\u6240\u6709\u4E3B\u9898\u5BF9\u8C61\u7684\u7D2F\u79EF\u884C\u4E3A,\u4F8B\u5982\u6BCF \u4E2A\u5730\u533A\u6700\u8FD1 7 \u5929(15 \u5929\u300130 \u5929\u300160 \u5929)\u7684\u4E0B\u5355\u6B21\u6570\u3001\u4E0B\u5355\u91D1\u989D\u7B49\u3002</li></ul><h3 id="ads-\u5C42" tabindex="-1"><a class="header-anchor" href="#ads-\u5C42" aria-hidden="true">#</a> ADS \u5C42</h3><p>ADS \u5C42\u4E0D\u6D89\u53CA\u5EFA\u6A21\uFF0C\u5EFA\u8868\u6839\u636E\u5177\u4F53\u9700\u6C42\u800C\u5B9A\u3002\u5BF9\u7535\u5546\u7CFB\u7EDF\u5404\u5927\u4E3B\u9898\u6307\u6807\u5206\u522B\u8FDB\u884C\u5206\u6790</p><h2 id="\u5176\u5B83" tabindex="-1"><a class="header-anchor" href="#\u5176\u5B83" aria-hidden="true">#</a> \u5176\u5B83</h2><ul><li>\u7565</li></ul>',44),r=[l];function h(n,c){return d(),e("div",null,r)}var p=t(i,[["render",h],["__file","03_\u6570\u636E\u4ED3\u5E93\u5EFA\u6A21.html.vue"]]);export{p as default};
